import React ,{ Component } from 'react';
import Particles from 'react-particles-js'
import Nav from './components/nav/nav'  
import Logo from './components/logo/logo'
import Imageform from './components/imageform/imageform'  
import Clarifai from 'clarifai';
import Facepicture from './components/facepicture/facepicture';
import './App.css';


const app = new Clarifai.App({
 apiKey: '2c21491a673d4d378ab2fa942b61baeb'
});
const particle={
                particles: {
                  line_linked: {
                    shadow: {
                      enable: true,
                      color: "#3CA9D1",
                      blur: 5
                    }
                  }
                }
 }

class App extends Component {
  constructor() {
    super();
    this.state = {
      input:'',
      imageUrl:''
    }
  }
  onInputchange = (event) =>{
    console.log(event.target.value);
  }
  onsubmit = () =>{
    this.setState({imageUrl:input})
    app.models.predict(Clarifai.COLOR_MODEL, "https://samples.clarifai.com/face-det.jpg").then(
    function(response) {
      console.log(response)
    },
    function(err) {
      // there was an error
    }
  );
 }
   render(){
      return (
        <div className="App">
          <Particles className='particles' params={particle} />
          <Nav />
          <Logo />
          <Imageform onInputchange={this.onInputchange} onsubmit={this.onsubmit}/>
          <Facepicture imageUrl={this.state.imageUrl}/>
        </div>
    );
  }
}

export default App;
